import React from "react"
import Imageformat from './imageformat'
import { SRLWrapper } from "simple-react-lightbox";

import az from './images/az.jpg'
import joey from './images/joey.jpg'
import deftones from './images/deftones.jpg'
import fa from './images/fa.jpg'
import nas from './images/nas.jpg'
import denzel from './images/denzel.jpg'
import primer from './images/primer.jpg'
import vangelis from './images/vangelis.jpg'

export class Imagedata extends Component {
    render() {
        const albums = [{
            photo: az,
            id: 1,
            title: "Doe or Die"
        },
        {
            photo: joey,
            id: 2,
            title: "1999"
        },
        {
            photo: deftones,
            id: 3,
            title: "Around the Fur"
        },
        {
            photo: fa,
            id: 4,
            title: "Fallen Angels"
        },
        {
            photo: nas,
            id: 5,
            title: "Illmatic"
        },
        {
            photo: denzel,
            id: 6,
            title: "Imperial"
        },
        {
            photo: primer,
            id: 7,
            title: "Introduction to Mayhem"
        },
        {
            photo: vangelis,
            id: 8,
            title: "Blade Runner"
        },
        ]

        return (
            <div className = "images-display">
                <SRLWrapper>
                    <ImageList images = {albums}/>
                </SRLWrapper>
            </div>
        )
    }
}

export default Imagedata
